INSERT INTO `articles` VALUES (1,'SKAI Launch (AI chatbot)','article1','<p>The average person uses 3-5 apps per day and the big app purge is not long away. Apps have made content delivery harder by putting multiple friction points finding the right app signing up & signing in, learning a New UI, remembering the App.</p>','<p><span style=\"font-family:Montserrat;\"><span style=\"font-size:12pt\">The average person uses 3-5 apps per day and the big app purge is not long away. Apps have made content delivery harder by putting multiple friction points finding the right app signing up &amp; signing in, learning a new UI, remembering the App. As a result, only a handful of apps have risen to the top and occupy valuable mind estate and these are the apps we use every day The other 99.99% of apps are sitting on the sideline, their tech goes unused. We have launched 4 different Bots covering the whole 360 degree view in our Eco-System. The 4 Bots serve to Customer, DSA/Dealers Business Partners and our Employees.</span></span></p>\r\n\r\n<p style=\"margin-bottom:16px\"><span style=\"font-family:Montserrat;\"><span style=\"font-size:12pt\">We at Ess Kay are already working on the same to take a great Jeap with our Business completion in terms of Service delivery Customer Onboarding, Retention and working towards better environment via Paperless delivery. Via this we shall be able to deliver great user experience with minimum intervention and negligible scalability costs.</span></span></p>','uploads/articles/skf-bot.gif',NULL,'PUBLISHED','2019-10-16',1,'2020-10-14 16:47:48','2020-12-04 18:18:48',NULL),(15,'Human Resource Activities','human-resource-activities','<p>Talent Identification & Acquisition </p>','<p><span style=\"font-family:Montserrat;\">HR function on the constant effort to identify &amp; Incept Top Talent from the market successfully on-boarded 703 employees across geographies in previous quarter. Amongst them 16 employees on boarded were are on key leadership role inclusive Mr. Nripendra Singh &ndash; Business Head Two Wheeler, Mr. Prakhar Khushwaha &ndash; Chief Product Manager, Mr. Ajay Sharma &ndash; Regional Manger Collections. Further 308 offers are in market amongst which 44 are of senior and managerial positions.</span></p>','uploads/articles/blog_image6.jpg',NULL,'PUBLISHED','2020-09-01',0,'2020-12-04 16:45:12','2020-12-04 16:47:03',NULL),(16,'Human Resource Activities','human-resource-activities-1','<p>Learning & Development </p>','<p><span style=\"font-family:Montserrat;\">Our L&amp; D team via multiple tech tools Inducted, Trained &amp; Mentored new incumbent &amp; employees at the various stages<br />\r\nof life cycle.</span><br />\r\n&nbsp;</p>\r\n\r\n<p><span style=\"font-family:Montserrat;\">1.&nbsp; In last quarter, 582 employees were inducted within rst week of joining under the Induction program<br />\r\nPrarambh.</span></p>\r\n\r\n<p><br />\r\n<span style=\"font-family:Montserrat;\">2. Under Shashaktikaram, 1339 employees were given educational capsule on Branch Audit, Branch CROP<br />\r\neffciency enhancement &amp; Motor Insurance.</span></p>\r\n\r\n<p><br />\r\n<span style=\"font-family:Montserrat;\">3. Under Arjun, 1958 employees were trained on ZIP NACH &amp; Two Wheeler &ldquo;Umang Policy&rdquo;.</span></p>\r\n\r\n<p><br />\r\n<span style=\"font-family:Montserrat;\">4. Under Jagriti, employees were trained on Chat Boat, Collection Incentive, Bharat Bill Payment Services,<br />\r\nBusiness Partner Elevation Program &amp; Kaizala.</span></p>\r\n\r\n<p><br />\r\n<span style=\"font-family:Montserrat;\">It shall be our continuous endeavor to keep the working culture motivated with knowledge building along with appreciation of efforts and time invested by each and every one of the employee for the roles they represent. The HR Team themselves took the slowdown as a buffer time available to get the company engrossed with employee involvement and development. We are happy to announce that there was no discontinuation of employees with EssKay with the underlying reason of the Pandemic. The applications for attrition received were for personal growth of employees themselves as we feel great to have provided career growth options to employees with the training and experience gained with their stint in Ess Kay.</span></p>','uploads/articles/blog_image3.jpg',NULL,'PUBLISHED','2020-09-01',0,'2020-12-04 16:56:49','2021-02-24 12:19:46',NULL),(17,'App for Video call in SME','app-for-video-call-in-sme','<p> In an initiative to make the best of the slowdown, the digital team of Ess Kay Fincorp has taken various steps in its\r\nagenda to improvise our systems and processes.</p>','<p><span style=\"font-family:Montserrat;\">App for video call in SME is enabled now for all personnel in this vertical. This reduces our TAT via eliminating physical visits to Customer location via different teams. Every team personnel can video call to the required personnel directly via app and the same is recorded, saved and tagged to the deal for future references. All the Credit personal discussions activities to Legal and technical reviews are enabled via virtual calls enabling team to work on case simultaneously and hand in hand with zero time delay.</span></p>','uploads/articles/t1.jpg',NULL,'PUBLISHED','2020-09-01',0,'2020-12-04 17:06:29','2020-12-04 17:55:24',NULL),(18,'Fund Raising Development','fund-raising-development','<p>In the month of September 2020</p>','<p><span style=\"font-family:Montserrat;\">We have raised funds to the tune of Rs. 655.38 Crores of which Rs. 370.88 Crs were raised in the quarter ended September 2020. With the total funds raised and collection effciencies hovering 95%+ which is providing us concidence that with the transactions where active conversations are live totaling to Rs. 1,300 Crores (of which Rs. 795 Crores of transactions are at very advanced stage under various levels of execution) it should provide us with ample visibility to navigate through current FY 2020-21.</span></p>\r\n\r\n<p><span style=\"font-family:Montserrat;\">The transactions closed during the Quarter ended September 2020 were diversifed cluster of Non-Convertible Debentures (NCDs), Term Loans and Pass Through Certicates (PTCs) invested/lent by Private Banks, Development Financial Institutions and Public Sector Bank. The key characteristics of these investments were as under:</span></p>','uploads/articles/C1.PNG',NULL,'PUBLISHED','2020-09-01',0,'2020-12-04 17:12:02','2020-12-04 17:12:02',NULL),(19,'Disbursements','disbursements','<p> Disbursements- Geography/State wise </p>','<p><span style=\"font-family:Montserrat;\">Covid and Lockdown impacted the country in different magnitudes depending upon the demographic distribution,<br />\r\nindustrial clusters in each state, presence of migrant class workers, concentration of population, Metro/Non Metro,<br />\r\nRural/Urban/Semi-urban and various other parameters. While what stands to the advantage of Ess Kay is that we<br />\r\noperate 97% in the rural and semi-urban geographies and 3% in Urban, and the rst and foremost determining factor<br />\r\nto understand the impact of Covid was that the pandemic interrupted the normal routine in the urban areas which<br />\r\nhad mass concentration of population and where social distancing norms were difcult to follow to avoid the spread.<br />\r\nAs we can see in the graph above, post pandemic we started with our disbursals in Rajasthan, Punjab, Gujarat and<br />\r\nMadhya Pradesh since these geographies showed lesser impact of Covid and Lockdown and large spread of<br />\r\nagricultural activities boosted the money ow in these regions. We gradually increased our reach in other states as<br />\r\nwell that we operate in after the unlock was widened in Maharashtra and Haryana in Q2 FY 2021 which we also drew<br />\r\ncomfort from resumption of economic activities and deployment of vehicle in income generating activities.</span></p>','uploads/articles/D1.PNG',NULL,'PUBLISHED','2020-09-01',0,'2020-12-04 17:18:59','2020-12-04 17:18:59',NULL),(20,'Collection Efficiencies','collection-efficiencies','<p>What helped improvise the Collection Efficiencies?</p>','<p><span style=\"font-family:Montserrat;\">i. The frst and primary factor as explained above is Customer Education</span></p>\r\n\r\n<p><br />\r\n<span style=\"font-family:Montserrat;\">ii. The routing of the Entire Sales and Collection Team towards collection reminders from all the customers and<br />\r\nregular follow ups from customers who did not pay EMI on the exact due dates</span></p>\r\n\r\n<p><br />\r\n<span style=\"font-family:Montserrat;\">iii. Collection from customers through other means of repayment as would be convenient to customers and keeping<br />\r\nall options open for it</span></p>\r\n\r\n<p><br />\r\n<span style=\"font-family:Montserrat;\">iv. Rural and Semi Urban Concentration of book to the extent of 97% which was not impacted due to Covid played a<br />\r\nmajor role in bringing back the collection efciencies at Pre-Covid levels</span></p>\r\n\r\n<p><br />\r\n<span style=\"font-family:Montserrat;\">v. Dependency on agriculture, cattle farming and other secondary sources of income from primary sector of<br />\r\neconomy strengthened the ability to pay. Good Monsoons and resultant bumper Rabi and Kharif Harvest helped<br />\r\nthe wheel running for income generation of the customers</span></p>\r\n\r\n<p><br />\r\n<span style=\"font-family:Montserrat;\">vi. Collateral investigation made mandatory at DDE Stage and from now onwards branch crop user have to ll<br />\r\ninformation in collateral investigation mandatorily</span></p>','uploads/articles/blog_image8.jpg',NULL,'PUBLISHED','2020-09-01',0,'2020-12-04 17:21:38','2020-12-04 17:21:38',NULL),(21,'Quarterly Journal','quarterly-journal','<p>Quarterly Journal for September month </p>','<p><span style=\"font-family:Montserrat;\">Ess Kay Fincorp is pleased to release the next edition of the Journal which runs pass through the various developments that took place in September 2020 and are resultant of the conservative steps taken in Q1 FY 2021 while we were preparing for the comeback from the Slow Down.</span></p>\r\n\r\n<p><br />\r\n<span style=\"font-family:Montserrat;\">We are thankful to all our stakeholders to have demonstrated their trust in our business and our customers to have abided by their debt obligations and maintained a disciplined repayment behavior. While the pandemic is yet in the system, we believe the economy has accommodated to the new normal and we all are in our own ways finding out means and measures to continue to operate without further interruptions. We are excited to work over the next half of the year since the unlock phases have almost freed the scope of operations for all sectors of the economy and we have a lot in agenda which includes staying connected and justifying the continuous support and concidence extended by each one of you.\\</span></p>\r\n\r\n<p><br />\r\n<span style=\"font-family:Montserrat;\">We are engaged in testing and modifying our business continuity plans and making the system strong and robust to such challenges which though temporary can cause slowdowns. We are grateful to these tough times since it allowed to pause, look back, analyze and bring in action necessary changes in the system to make it abreast with forward looking changes. We believe each element that makes a business idea a functional machine needs to be polished and lubricated for keeping up the pace with which it has to run the show. We are happy to know that the processes and systems which we were operating upon for years were resilient to such a pandemic situation and the solutions offered by these processes helped us come out of the slowdown and gear up to run at Pre Covid Levels.</span></p>\r\n\r\n<p><br />\r\n<span style=\"font-family:Montserrat;\">The results that have come out is a joint effort of the entire family of Ess Kay and we have been proud over our system to have people who kept value adding when the situation demanded out of box thinking. We have been on the ground and very close to our customers because of which we understand what does our target market and audience demand and so, we can effectively reciprocate to the call of action. We thank each and every one guiding and executing the action plan and we hope to make the next half year a very productive one.</span><br />\r\n&nbsp;</p>','uploads/articles/blog_image9.jpg','uploads/article_pdf/Ess Kay Journal _Sept\' 20.pdf','PUBLISHED','2020-09-01',0,'2020-12-04 17:27:24','2020-12-04 17:27:24',NULL);
