ass=\"card-body\">\r\n<h1>Message From MD / CXOs</h1>\r\n\r\n<p>INVERTEDLEFT&nbsp; She is a whole-time Director of the company is Co-promoter of the Company. She has 6 years of experience in the industry. She actively participates in strategic decision making of the company. She is an eternal optimist and has promoted ethics in working environment by creating a work culture which provide a stabilized growth environment and motivation. INVERTEDRIGHT</p>\r\n\r\n<h5 class=\"name\">- Ms. Shalini Setia</h5>\r\n\r\n<p class=\"designation\">Whole-time Director</p>\r\n</div>\r\n\r\n<div class=\"msg-img\"><img alt=\"There are many variations of passages of lorem ipsum available\" class=\"img-fluid\" src=\"uploads/page/board-d-2.png\" /></div>\r\n</div>\r\n\r\n<div class=\"center-content\">\r\n<div class=\"card-body\">\r\n<h1>Message From MD / CXOs</h1>\r\n\r\n<p>INVERTEDLEFT&nbsp; Ms. Debanshi Basu is a Chartered Accountant having 17 years of experience across private equity, investment banking, audit and corporate finance. She has spent the last eleven years with Baring Private Equity India across investments and portfolio management primarily in the banking and financial service sectors and has led fund investments in various other sectors. She led investments in Manappuram Finance, Muthoot Finance and others and is involved actively managing these portfolios. She was part of Goldman Sachs&#39; first investment banking team in Mumbai and worked with their M&amp;A and capital markets team for around five years. INVERTEDRIGHT</p>\r\n\r\n<h5 class=\"name\">- Ms. Debanshi Basu</h5>\r\n\r\n<p class=\"designation\">Nominee Director</p>\r\n</div>\r\n\r\n<div class=\"msg-img\"><img alt=\"There are many variations of passages of lorem ipsum available\" class=\"img-fluid\" src=\"uploads/page/board-d-3.png\" /></div>\r\n</div>\r\n\r\n<div class=\"center-content two\">\r\n<div class=\"card-body\">\r\n<h1>Message From MD / CXOs</h1>\r\n\r\n<p>INVERTEDLEFT&nbsp; A postgraduate in Economics from Agra University, joined Allahabad Bank as Management Trainee in 1978 and worked in different capacities in various branches of Allahabad Bank holding important assignments. He is a versatile banker having 34 years of rich experience in Credit, Forex and other General Banking Operations. He has completed his term of office as Executive Director of corporation bank.INVERTEDRIGHT</p>\r\n\r\n<h5 class=\"name\">- Mr. Amar Lal Daultani</h5>\r\n\r\n<p class=\"designation\">Independent Director</p>\r\n</div>\r\n\r\n<div class=\"msg-img\"><img alt=\"There are many variations of passages of lorem ipsum available\" class=\"img-fluid\" src=\"uploads/page/board-d-4.png\" /></div>\r\n</div>\r\n\r\n<div class=\"center-content\">\r\n<div class=\"card-body\">\r\n<h1>Message From MD / CXOs</h1>\r\n\r\n<p>INVERTEDLEFT&nbsp; Mr. Anand Raghavan, a Chartered Accountant by Profession has over 30+ years of experience with different entities like Sundaram Finance &amp; Ernst &amp; Young LLP. He is currently serving as special advisor in Ernst &amp; Young LLP along-with directorship in reputed organization such as MMTC Limited, Five Star Business Limited, Five Star Housing Finance Private Limited and Sterling Holiday Resort Limited. INVERTEDRIGHT</p>\r\n\r\n<h5 class=\"name\">- Mr. Anand Raghavan</h5>\r\n\r\n<p class=\"designation\">Independent Director</p>\r\n</div>\r\n\r\n<div class=\"msg-img\"><img alt=\"There are many variations of passages of lorem ipsum available\" class=\"img-fluid\" src=\"uploads/page/board-d-5.png\" /></div>\r\n</div>\r\n\r\n<div class=\"center-content two\">\r\n<div class=\"card-body\">\r\n<h1>Message From MD / CXOs</h1>\r\n\r\n<p>INVERTEDLEFT&nbsp; Mr. Akshay Tanna is a Partner with TPG Growth in Mumbai and has been with TPG since 2011. Akshay is a member of the Firm&rsquo;s Diversity &amp; Inclusion Council. Prior to joining TPG in 2011, Akshay worked for Merrill Lynch and Deutsche Bank in the Financial Institutions Investment Banking Group. Akshay graduated from the Wharton School of the University of Pennsylvania with Honors. He currently serves on the Boards of Big Tree Entertainment Pvt Ltd (BookMyShow), Dodla Dairy Ltd, FSN E-Commerce Ventures Pvt Ltd (Nykaa), Landmark Insurance Brokers Pvt Ltd, Lenskart Solutions Pvt Ltd, and Livspace Pte Ltd.&nbsp; INVERTEDRIGHT</p>\r\n\r\n<h5 class=\"name\">- Mr. Akshay Tanna</h5>\r\n\r\n<p class=\"designation\">Nominee Director</p>\r\n</div>\r\n\r\n<div class=\"msg-img\"><img alt=\"There are many variations of passages of lorem ipsum available\" class=\"img-fluid\" src=\"uploads/page/board-d-6.png\" /></div>\r\n</div>\r\n</div>\r\n</div>','{\"meta_title\":\"EssKay Fincorp Limited | Home Page\",\"meta_description\":\"Home Page\",\"meta_keywords\":\"home, esskay. esskeyfincorp, ess kay, esskay fincorp\"}',NULL,'2021-03-23 13:09:03',NULL),(11,'services','Key Managerial Person','Key Managerial Person','key-managerial-person','<div class=\"row\">\r\n<div class=\"col-sm-12\">\r\n<div class=\"center-content\">\r\n<div class=\"card-body\">\r\n<h1>Message From MD / CXOs</h1>\r\n\r\n<p>INVERTEDLEFT Mr. Atul Arora is Chartered accountant by profession, started his career with Taurian Manganese &amp; Ferro Alloy CISA a mining company based in Ivory coast, After 2 years of international finance exposure he has joined Ess Kay Fincorp Limited in 2010. With his diverse experience gained through range of assignments handled during his stint with the company has grown along and currently holds position of Chief Financial Officer in the company. INVERTEDRIGHT</p>\r\n\r\n<h5 class=\"name\">- Mr. Atul Arora</h5>\r\n\r\n<p class=\"designation\">CHIEF FINANCIAL OFFICER</p>\r\n</div>\r\n\r\n<div class=\"msg-img\"><img alt=\"There are many variations of passages of lorem ipsum available\" class=\"img-fluid\" src=\"uploads/page/key-mp-1.png\" /></div>\r\n</div>\r\n\r\n<div class=\"center-content two\">\r\n<div class=\"card-body\">\r\n<h1>Message From MD / CXOs</h1>\r\n\r\n<p>INVERTEDLEFT Mr. Girish Dangayach is a Chartered Accountant and Certified Digital Strategist from Columbia University with more than 13 years of strong experience. Previously Girish worked with Genpact, Deloitte, Accenture, KPMG and Infosys. Girish helped many global leading fortune 500 companies to transform their business processes in the area of Sales Operations, Finance, Customer Service, Procurement, HR and Manufacturing. At SK, Girish is working to build best in class processes and introducing new age digital technologies to enhance experience for customer and colleagues INVERTEDRIGHT</p>\r\n\r\n<h5 class=\"name\">- Mr. Girish Dangayach</h5>\r\n\r\n<p class=\"designation\">CHIEF DIGITAL OFFICER</p>\r\n</div>\r\n\r\n<div class=\"msg-img\"><img alt=\"There are many variations of passages of lorem ipsum available\" class=\"img-fluid\" src=\"uploads/page/key-mp-2.png\" /></div>\r\n</div>\r\n\r\n<div class=\"center-content\">\r\n<div class=\"card-body\">\r\n<h1>Message From MD / CXOs</h1>\r\n\r\n<p>INVERTEDLEFT Mr. Pratit Vijayvergia is an IT professional with almost 18 years of vibrant experience.<br />\r\nWith his best skills, he evolved as an entrepreneur by setting his own organization named TechnoXpert Infosystems and worked as a CEO for almost a decade. During his entrepreneurship, he has provided the technology solutions and consultancy for organizations and benchmarked the level of profitability through his expertise to major clients from the BFSI and Automobile sectors.<br />\r\nAs CTO, his role is to infuse the latest technology into our services across all divisions. His mix of business and technical expertise positions him perfectly to continue putting Ess Kay at the forefront of the disciplines in which we operate. INVERTEDRIGHT</p>\r\n\r\n<h5 class=\"name\">- Mr. Pratit Vijayvargiya</h5>\r\n\r\n<p class=\"designation\">CHIEF TECHNICAL OFFICER</p>\r\n</div>\r\n\r\n<div class=\"msg-img\"><img alt=\"There are many variations of passages of lorem ipsum available\" class=\"img-fluid\" src=\"uploads/page/key-mp-3.png\" /></div>\r\n</div>\r\n\r\n<div class=\"center-content two\">\r\n<div class=\"card-body\">\r\n<h1>Message From MD / CXOs</h1>\r\n\r\n<p>INVERTEDLEFT He is MBA Finance / B-Com(Hon) having 17 years of experience in Finance Industry (Rajasthan &amp; Gujarat State). He started career with Ess Kay Fincorp in year 1999 as a sales manager &amp; with continue growth currently holding position of Senior Vice President (Western Region) in the company. INVERTEDRIGHT</p>\r\n\r\n<h5 class=\"name\">- Mr. Ritesh Sharma</h5>\r\n\r\n<p class=\"designation\">CHIEF OPERATING OFFICER-WEST</p>\r\n</div>\r\n\r\n<div class=\"msg-img\"><img alt=\"There are many variations of passages of lorem ipsum available\" class=\"img-fluid\" src=\"uploads/page/key-mp-4.png\" /></div>\r\n</div>\r\n\r\n<div class=\"center-content\">\r\n<div class=\"card-body\">\r\n<h1>Message From MD / CXOs</h1>\r\n\r\n<p>INVERTEDLEFT Mr. Sameer Arora a Civil Engineer by qualification has 27+ years of experience. He started his career as an entrepreneur and joined Ess Kay Fincorp in the year 2007 with ~10 years of extensive experience in the field of sales, collection and operations. With his diversified skill set he carries specialized hold on sales and marketing of financial products. He is one of the main drivers of devising new product strategies and overlooking its implementation on the ground. INVERTEDRIGHT</p>\r\n\r\n<h5 class=\"name\">- Mr. Sameer Arora</h5>\r\n\r\n<p class=\"designation\">CHIEF OPERATING OFFICER- NORTH</p>\r\n</div>\r\n\r\n<div class=\"msg-img\"><img alt=\"There are many variations of passages of lorem ipsum available\" class=\"img-fluid\" src=\"uploads/page/key-mp-5.png\" /></div>\r\n</div>\r\n\r\n<div class=\"center-content two\">\r\n<div class=\"card-body\">\r\n<h1>Message From MD / CXOs</h1>\r\n\r\n<p>INVERTEDLEFT Abhijit Sharma a Graduate in Law from Rajasthan University, having experience of more than 15+ years in the field of collection. He started his Career in with ICICI Bank and has worked with Airtel and Indiabulls in various positions predominantly in the state of Rajasthan and Gujarat. He is associated with of Ess Kay Fincorp since 2010 and through his acumen and ability has scaled to the level of Senior Manager (Collection). INVERTEDRIGHT</p>\r\n\r\n<h5 class=\"name\">- Mr. Abhijeet Sharma</h5>\r\n\r\n<p class=\"designation\">STATE COLLECTION MANAGER</p>\r\n</div>\r\n\r\n<div class=\"msg-img\"><img alt=\"There are many variations of passages of lorem ipsum available\" class=\"img-fluid\" src=\"uploads/page/key-mp-6.png\" /></div>\r\n</div>\r\n\r\n<div class=\"center-content\">\r\n<div class=\"card-body\">\r\n<h1>Message From MD / CXOs</h1>\r\n\r\n<p>INVERTEDLEFT Amarpreet Singh Batra, having over 15 years of experience with reputed corporates. He holds a B.Tech Degree in Mechanical Stream from SSBT&#39;s College, Jalgaon Maharashtra. Prior to joining Ess Kay ,he was heading Rajasthan State as General Manager in Magma Fincorp Limited. INVERTEDRIGHT</p>\r\n\r\n<h5 class=\"name\">- Mr. Amarpreet Singh Batra</h5>\r\n\r\n<p class=\"designation\">NATIONAL BUSINESS HEAD-MACHINES</p>\r\n</div>\r\n\r\n<div class=\"msg-img\"><img alt=\"There are many variations of passages of lorem ipsum available\" class=\"img-fluid\" src=\"uploads/page/key-mp-7.png\" /></div>\r\n</div>\r\n\r\n<div class=\"center-content two\">\r\n<div class=\"card-body\">\r\n<h1>Message From MD / CXOs</h1>\r\n\r\n<p>INVERTEDLEFT Ms. Anagha Bangur a Company Secretary by qualification, has served in salt manufacturing company viz. with Saboo Sodium Chloro Limited which was listed on Bombay Stock Exchange. Anagha Joined Esskay Fincorp in 2013. Has experience in formulation of Group Financial Policies, Corporate Laws, Merchant Banking, Equity and Debt Listing and ensuring adherence to the statutory regulations of listed, non listed Companies. INVERTEDRIGHT</p>\r\n\r\n<h5 class=\"name\">- Ms. Anagha Bangur</h5>\r\n\r\n<p class=\"designation\">COMPANY SECRETARY</p>\r\n</div>\r\n\r\n<div class=\"msg-img\"><img alt=\"There are many variations of passages of lorem ipsum available\" class=\"img-fluid\" src=\"uploads/page/key-mp-8.png\" /></div>\r\n</div>\r\n\r\n<div class=\"center-content\">\r\n<div class=\"card-body\">\r\n<h1>Message From MD / CXOs</h1>\r\n\r\n<p>INVERTEDLEFT Anil is EDPHRM from XLRI and MBA HR from Annamalai university , having experience of 15+ years in HR Domain with Asset Finance / Banking Industry. He has worked with Mahindra Finance, L&amp; T Finance, IndusInd Bank ,Infosys etc with proven track record on Talent management and HR practices setup across the geography INVERTEDRIGHT</p>\r\n\r\n<h5 class=\"name\">- Mr. Anil Sharma</h5>\r\n\r\n<p class=\"designation\">NATIONAL HEAD - HUMAN RESOURCES</p>\r\n</div>\r\n\r\n<div class=\"msg-img\"><img alt=\"There are many variations of passages of lorem ipsum available\" class=\"img-fluid\" src=\"uploads/page/key-mp-9.png\" /></div>\r\n</div>\r\n\r\n<div class=\"center-content two\">\r\n<div class=\"card-body\">\r\n<h1>Message From MD / CXOs</h1>\r\n\r\n<p>INVERTEDLEFT Mr. Harendra started his career with Ess Kay Fincorp Limited in the year 1995. He moved on to different organization through his career and has worked with organization like GE, ICICI Bank Limited and Kotak Mahindra Bank. He started his career as an executive level manager but with his ability and understanding of geography and business has now attained the position of State Collection Manager for the state of Rajasthan. He has worked in various sphere of Collection /Debts Recovery and Risk Management during his entire stint with various organization. INVERTEDRIGHT</p>\r\n\r\n<h5 class=\"name\">- Mr. Harendra Singh Rathore</h5>\r\n\r\n<p class=\"designation\">STATE COLLECTION MANAGER</p>\r\n</div>\r\n\r\n<div class=\"msg-img\"><img alt=\"There are many variations of passages of lorem ipsum available\" class=\"img-fluid\" src=\"uploads/page/key-mp-10.png\" /></div>\r\n</div>\r\n\r\n<div class=\"center-content\">\r\n<div class=\"card-body\">\r\n<h1>Message From MD / CXOs</h1>\r\n\r\n<p>INVERTEDLEFT A Chartered Accountant and a Company Secretary by qualification, has 5 years of core accounting and auditing experience. He started his career as an Internal Audit Head in the company and is now acting as the Associate Vice President (Accounts) of the company. INVERTEDRIGHT</p>\r\n\r\n<h5 class=\"name\">- Mr. Honey Jain</h5>\r\n\r\n<p class=\"designation\">CHIEF ACCOUNTS OFFICER</p>\r\n</div>\r\n\r\n<div class=\"msg-img\"><img alt=\"There are many variations of passages of lorem ipsum available\" class=\"img-fluid\" src=\"uploads/page/key-mp-11.png\" /></div>\r\n</div>\r\n\r\n<div class=\"center-content two\">\r\n<div class=\"card-body\">\r\n<h1>Message From MD / CXOs</h1>\r\n\r\n<p>INVERTEDLEFT Mihir Vaishnav graduated from Mumbai University and pursued MBA Has corporate experience of 24 years having worked with Times Group, 20th Century Finance, GMAC, IDBI Bank, TVS Credit, and ICICI Bank. He has worked in domain of Retail Assets and Liabilities having handled product range of 20k to 2 cr which includes financing of Two Wheeler, Auto, Commercial Vehicle, Construction Equipment, Mortgage (HL &amp; SME). INVERTEDRIGHT</p>\r\n\r\n<h5 class=\"name\">- Mr. Mihir Vaishnav</h5>\r\n\r\n<p class=\"designation\">NATIONAL BUSINESS HEAD-SME</p>\r\n</div>\r\n\r\n<div class=\"msg-img\"><img alt=\"There are many variations of passages of lorem ipsum available\" class=\"img-fluid\" src=\"uploads/page/key-mp-12.png\" /></div>\r\n</div>\r\n\r\n<div class=\"center-content\">\r\n<div class=\"card-body\">\r\n<h1>Message From MD / CXOs</h1>\r\n\r\n<p>INVERTEDLEFT Rajeev Yadav PGDBM (Marketing) and a Law graduate by qualification. He has in all a total experience of 15+ years. He started his career with Cipla Limited in the year 2000 and then moved on to Hinduja Leyland Ltd, Mahindra Finance and ICICI Bank Limited. He has diversified experience of sales, compliance, collection, banking regulations of NBFCs and Bank. He heads legal department for the company and currently takes care of all the legal matters on behalf of the company INVERTEDRIGHT</p>\r\n\r\n<h5 class=\"name\">- Mr. Rajeev Yadav</h5>\r\n\r\n<p class=\"designation\">NATIONAL LEGAL HEAD</p>\r\n</div>\r\n\r\n<div class=\"msg-img\"><img alt=\"There are many variations of passages of lorem ipsum available\" class=\"img-fluid\" src=\"uploads/page/key-mp-13.png\" /></div>\r\n</div>\r\n\r\n<div class=\"center-content two\">\r\n<div class=\"card-body\">\r\n<h1>Message From MD / CXOs</h1>\r\n\r\n<p>INVERTEDLEFT With 5 years of field experience he joined Ess Kay in 2008 as an operation executive, with his dedication and continuous skill up-gradation, he currently holds the position on Operation Head. INVERTEDRIGHT</p>\r\n\r\n<h5 class=\"name\">- Mr. Ritesh Kumar</h5>\r\n\r\n<p class=\"designation\">NATIONAL HEAD - OPERATIONS</p>\r\n</div>\r\n\r\n<div class=\"msg-img\"><img alt=\"There are many variations of passages of lorem ipsum available\" class=\"img-fluid\" src=\"uploads/page/key-mp-14.png\" /></div>\r\n</div>\r\n\r\n<div class=\"center-content\">\r\n<div class=\"card-body\">\r\n<h1>Message From MD / CXOs</h1>\r\n\r\n<p>INVERTEDLEFT Mr. Vivek Singh is a Post Graduate with specialization in the field of finance, accounts, tax and international business. He is a Chartered accountant and PGDIB in International Business from India Institute of Foreign Trade (New Delhi). He started his career with Traxun Towers Limited and has spent almost 14+ years in the field of Corporate Finance in the past while working with Corporate Group&#39;s such as RPG Enterprise, Ladder up Finance Limited and Reliance ADAG. INVERTEDRIGHT</p>\r\n\r\n<h5 class=\"name\">- Mr. Vivek Singh</h5>\r\n\r\n<p class=\"designation\">HEAD - TREASURY</p>\r\n</div>\r\n\r\n<div class=\"msg-img\"><img alt=\"There are many variations of passages of lorem ipsum available\" class=\"img-fluid\" src=\"uploads/page/key-mp-15.png\" /></div>\r\n</div>\r\n\r\n<div class=\"center-content two\">\r\n<div class=\"card-body\">\r\n<h1>Message From MD / CXOs</h1>\r\n\r\n<p>INVERTEDLEFT Mr Yash Setia, started his Career with Esskay in 2017, is involved in all business strategies and growth plans of the company. A HR College of Commerce and Economics Mumbai graduate, he has the acumen on data and technology and responsible for business development as well as profitable collection. INVERTEDRIGHT</p>\r\n\r\n<h5 class=\"name\">- Mr. Yash Setia</h5>\r\n\r\n<p class=\"designation\">HEAD-BUSINESS STRATEGY</p>\r\n</div>\r\n\r\n<div class=\"msg-img\"><img alt=\"There are many variations of passages of lorem ipsum available\" class=\"img-fluid\" src=\"uploads/page/key-mp-16.png\" /></div>\r\n</div>\r\n</div>\r\n</div>','{\"meta_title\":\"EssKay Fincorp Limited | Home Page\",\"meta_description\":\"Home Page\",\"meta_keywords\":\"home, esskay. esskeyfincorp, ess kay, esskay fincorp\"}',NULL,'2021-03-03 20:00:59',NULL),(12,'services','Video Page','Video Page','home','<div class=\"about-video-area d-none hide\">\r\n<div class=\"row h-100\">\r\n<div class=\"col-md-7 col-sm-12\">\r\n<div class=\"about-content h-100 justify-content-center d-flex\">Lorem Ipsum is simply dummy text of the printing and typesetting industry.</div>\r\n</div>\r\n\r\n<div class=\"col-md-5 col-sm-12\">\r\n<div class=\"about-video\">\r\n<div class=\"made-sk-box\">\r\n<div class=\"more-about-video\"><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" id=\"sk_frame1\" src=\"https://www.youtube.com/embed/9xwazD5SyVg\"></iframe>\r\n\r\n<div class=\"more-video-cont\" id=\"sk_video_cont\"><button class=\"speechmax-icon\" id=\"sk_video1\" type=\"button\"><img alt=\"\" src=\"public/assets/images/video-bg.png\" /> <img alt=\"\" class=\"play-btn-about\" src=\"public/assets/images/play-btn.svg\" /></button></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>','{\"meta_title\":\"EssKay Fincorp Limited | Home Page\",\"meta_description\":\"Home Page\",\"meta_keywords\":\"home, esskay. esskeyfincorp, ess kay, esskay fincorp\"}',NULL,'2021-03-23 11:15:19',NULL);
